import android.util.Log;
import android.view.View;
import android.view.Menu;
import android.view.MenuItem;
import android.widget.Toast;

import java.util.ArrayList;

public class ListActivity extends AppCompatActivity implements ListInterface.View {

    String TAG = "YourMusic/ListActivity";
    private ListInterface.Presenter presenter;
    private ArrayList<AlbumEntity> items;
    AlbumAdapter adapter;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        Log.d(TAG,"Starting onCreate");
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_list);
        Toolbar toolbar = findViewById(R.id.toolbar);
        setSupportActionBar(toolbar);

        presenter = new ListPresenter(this);

        FloatingActionButton fab = findViewById(R.id.fab);
        fab.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                Log.d(TAG,"Clicking floating button");
               presenter.onClickAddAlbum();
            }
        });

        items = new ArrayList<AlbumEntity>();

        AlbumEntity album1 = new AlbumEntity();
        album1.setAlbumName("Las Ganas");
        album1.setArtistName("Dani");
        album1.setImage("");
        album1.setId("1");
        items.add(album1);

       AlbumEntity album2 = new AlbumEntity();
        album2.setAlbumName("Diciembre");
        album2.setArtistName("Leiva");
        album2.setImage("");
        album2.setId("2");
        items.add(album2);

        AlbumEntity album3 = new AlbumEntity();
        album3.setAlbumName("Un Alumno");
        album3.setArtistName("Melendi");
        album3.setImage("");
        album3.setId("3");
        items.add(album3);

       AlbumEntity album4 = new AlbumEntity();
        album4.setAlbumName("Odisea");
        album4.setArtistName("Ozuna");
        album4.setImage("");
        album4.setId("4");
        items.add(album4);

        AlbumEntity album5 = new AlbumEntity();
        album5.setAlbumName("Oasis");
        album5.setArtistName("Bunny");
        album5.setImage("");
        album5.setId("5");
        items.add(album5);

        AlbumEntity album6 = new AlbumEntity();
        album6.setAlbumName("Nuclear");
        album6.setArtistName("Leiva");
        album6.setImage("");
        album6.setId("6");
        items.add(album6);

        AlbumEntity album7 = new AlbumEntity();
        album7.setAlbumName("Los Reales");
        album7.setArtistName("Anuell");
        album7.setImage("");
        album7.setId("7");
        items.add(album7);

        AlbumEntity album8 = new AlbumEntity();
        album8.setAlbumName("Follow Leader");
        album8.setArtistName("Korn");
        album8.setImage("");
        album8.setId("8");
        items.add(album8);

        AlbumEntity album9 = new AlbumEntity();
        album9.setAlbumName("Vida Rica");
        album9.setArtistName("Camilo");
        album9.setImage("");
        album9.setId("9");
        items.add(album9);

        AlbumEntity album10 = new AlbumEntity();
        album10.setAlbumName("Mi Teatro");
        album10.setArtistName("Dani");
        album10.setImage("");
        album10.setId("10");
        items.add(album10);


        // Inicializa el RecyclerView
        final RecyclerView recyclerView = (RecyclerView) findViewById(R.id.recyclerView);

        // Crea el Adaptador con los datos de la lista anterior
        adapter = new AlbumAdapter(items);

        // Asocia el elemento de la lista con una accin al ser pulsado
        adapter.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                // Accin al pulsar el elemento
                int position = recyclerView.getChildAdapterPosition(v);
                /*Toast.makeText(ListActivity.this, "Posicin: " + String.valueOf(position) +" Name: " + items.get(position).getName(), Toast.LENGTH_SHORT)
                        .show();
                 */
                presenter.onClickRecyclerViewAlbum(items.get(position).getId());
            }
        });

        // Asocia el Adaptador al RecyclerView
        recyclerView.setAdapter(adapter);

        // Muestra el RecyclerView en vertical
        recyclerView.setLayoutManager(new LinearLayoutManager(this));

        //Swipe
        ItemTouchHelper helper = new ItemTouchHelper(new ItemTouchHelper.SimpleCallback(0, ItemTouchHelper.RIGHT) {
            @Override
            public boolean onMove(@NonNull RecyclerView recyclerView, @NonNull RecyclerView.ViewHolder viewHolder, @NonNull RecyclerView.ViewHolder target) {
                return false;
            }

            @Override
            public void onSwiped(@NonNull RecyclerView.ViewHolder target, int direction) {
                presenter.onSwipedAlbum(target);
            }
        });

        helper.attachToRecyclerView(recyclerView);
    }


    @Override
    public boolean onCreateOptionsMenu(Menu menu) {
        // Inflate the menu; this adds items to the action bar if it is present.
        getMenuInflater().inflate(R.menu.menu_main, menu);
        return true;
    }

    @Override
    public boolean onOptionsItemSelected(MenuItem item) {
        // Handle action bar item clicks here. The action bar will
        // automatically handle clicks on the Home/Up button, so long
        // as you specify a parent activity in AndroidManifest.xml.
        int id = item.getItemId();

        //noinspection SimplifiableIfStatement
        if (id == R.id.action_search) {
            presenter.onClickSearchIcon();
        }
        if (id == R.id.action_sort) {
            return true;
        }
        if (id == R.id.action_configuration) {
            return true;
        }
        if (id == R.id.action_help) {
            return true;
        }
        if (id == R.id.action_about) {
            presenter.onClickAboutAppCRUD();
        }

        return super.onOptionsItemSelected(item);
    }

    @Override
    public void startFormActivity() {
        Log.d(TAG,"Starting FormActivity");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        startActivity(intent);
    }

    @Override
    public void startFormActivity(String id) {
        Log.d(TAG,"Starting FormActivityWithId");
        Intent intent = new Intent(getApplicationContext(), FormActivity.class);
        intent.putExtra("id", id);
        startActivity(intent);
    }

    @Override
    public void startSearchActivity() {
        Intent intent = new Intent(getApplicationContext(), SearchActivity.class);
        startActivity(intent);
    }

    @Override
    public void startAboutActivity() {
        Intent intent = new Intent(getApplicationContext(), AboutActivity.class);
        startActivity(intent);
    }

    @Override
    public void onSwipedRemove(RecyclerView.ViewHolder target) {
        int position = target.getAdapterPosition();
        AlbumEntity deleteAlbum = items.remove(position);
        if (deleteAlbum != null) {
            adapter.notifyDataSetChanged();
            Toast.makeText(ListActivity.this, getString(R.string.albumToast) + deleteAlbum.getAlbumName() + getString(R.string.deleteAlbumSuccess), Toast.LENGTH_LONG)
                    .show();
        } else {
            Toast.makeText(ListActivity.this, getString(R.string.deleteAlbumError), Toast.LENGTH_LONG)
                    .show();
        }

    }

    @Override
    protected void onStart() {
        Log.d(TAG, "Starting onStart");
        super.onStart();
    }

    @Override
    protected void onResume() {
        Log.d(TAG, "Starting onResume");
        super.onResume();
    }

    @Override
    protected void onPause() {
        Log.d(TAG, "Starting onPause");
        super.onPause();
    }

    @Override
    protected void onStop() {
        Log.d(TAG, "Starting onStop");
        super.onStop();
    }

    @Override
    protected void onRestart() {
        Log.d(TAG, "Starting onRestart");
        super.onRestart();
    }

    @Override
    protected void onDestroy() {
        Log.d(TAG, "Starting onDestroy");
        super.onDestroy();
    }
}